import React, { Component } from "react";
import Cardlist from "./cardlist"
import { services } from "./services";
import SearchBox from './SearchBox';

class App extends Component {
    constructor(){
        super()
        this.state = {
            services: services,
            Searchfield: ''
        }
    }
    render() {
        return(
            <div className="tc">
                <h1>Robotfriends</h1>
                <SearchBox />
                <Cardlist services={this.state.services} />
            </div>
        );
    }
}

export default App;
